CREATE DEFINER=`root`@`localhost` FUNCTION `obtener_documentos_por_proveedor`(id_proveedor_parametro INT) RETURNS int
    DETERMINISTIC
BEGIN
    DECLARE total INT;
    SELECT COUNT(*) INTO total
    FROM documento_proveedor
    WHERE id_proveedor = id_proveedor_parametro;
    RETURN total;
